import PropTypes from 'prop-types';

export default function Navbar({ brand, links }) {
  return (
    <nav className="navbar navbar-expand-lg bg-body-tertiary">
      <div className="container-fluid">
        <a className="navbar-brand" href={links && links[0] ? links[0].href : '/'}>{brand}</a>
        <button className="navbar-toggler" type="button" data-bs-toggle="collapse" data-bs-target="#navbarNav" aria-controls="navbarNav" aria-expanded="false" aria-label="Toggle navigation">
          <span className="navbar-toggler-icon"></span>
        </button>
        <div className="collapse navbar-collapse" id="navbarNav">
          <ul className="navbar-nav">
            {links && links.map((l, i) => (
              <li className="nav-item" key={i}>
                {l.disabled ? (
                  <button className="nav-link disabled btn" aria-disabled="true" disabled>{l.text}</button>
                ) : (
                  <a className={"nav-link" + (i === 0 ? ' active' : '')} aria-current={i === 0 ? 'page' : undefined} href={l.href}>{l.text}</a>
                )}
              </li>
            ))}
          </ul>
        </div>
      </div>
    </nav>
  );
}

Navbar.propTypes = {
  brand: PropTypes.string,
  links: PropTypes.arrayOf(
    PropTypes.shape({
      text: PropTypes.string.isRequired,
      href: PropTypes.string,
      disabled: PropTypes.bool,
    })
  ),
};

Navbar.defaultProps = {
  brand: 'Active',
  links: [
    { text: 'Home', href: '/' },
    { text: 'About', href: '/' },
    { text: 'Disabled', disabled: true },
  ],
};
